import React, { Component } from "react";
import Modal from 'react-bootstrap/Modal'
import Button from "react-bootstrap/Button";

export default class PopUp extends Component {
  handleClick = () => {
	this.props.toggle();
  };
  render() {
    return (
        <Modal show={true} onHide={this.handleClick} style={{display: 'flex',  justifyContent:'center', alignItems:'center' }} animation={true} centered>
        <Modal.Header closeButton>
        <Modal.Title>'s Profile</Modal.Title>
        </Modal.Header>
        <text style={{paddingLeft:"1%"}}>First name: </text>
        <br />
        <text style={{paddingLeft:"1%"}}>Last name: </text>
        <br />
        <text style={{paddingLeft:"1%"}}>Email: </text>
        <br />
        <text style={{paddingLeft:"1%"}}>Join date: </text>
        <Modal.Footer>
        <Button variant="primary" onClick={this.handleClick}>
            Close
        </Button>
        </Modal.Footer>
    </Modal>
    );
  }
}
